import React,{ Component } from 'react'
import { Accordion, List } from 'antd-mobile';

class Nav extends Component {
    onChange = (key) => {
        console.log(key);
      }
    render(){
        return (
            <div className="nav">
            {/*      <div className="navList"> */}
                    <div style={{ marginTop: 10, marginBottom: 10 }}>
                        <Accordion accordion openAnimation={{}} className="my-accordion" onChange={this.onChange}>
                            <Accordion.Panel header="首页"></Accordion.Panel>
                            <Accordion.Panel header="北京" className="pad"></Accordion.Panel>
                            <Accordion.Panel header="文艺演出" className="pad">
                            </Accordion.Panel>
                            <Accordion.Panel header="体育赛事" className="pad">this is panel content2 or other</Accordion.Panel>
                            <Accordion.Panel header="其他" className="pad">this is panel content2 or other</Accordion.Panel>
                        </Accordion>
                    </div>
                 {/* </div> */}
                <div className="navBtn">
                    <button>登录</button>
                    <p>客服电话：400-880-2880</p>
                </div>
            </div>
        )
    }

   
}

export default Nav;
